/* WARNING: Script requires that SQLITE_DBCONFIG_DEFENSIVE be disabled */
PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "ai_module_sectionoption" (
    "id" integer NOT NULL PRIMARY KEY AUTOINCREMENT,
    "section_type" varchar(20) NOT NULL,
    "text" text NOT NULL,
    "ctr" real NOT NULL DEFAULT 0.0,
    "cr" real NOT NULL DEFAULT 0.0,
    "success_score" real NOT NULL DEFAULT 0.0,
    "is_successful" bool NOT NULL DEFAULT false
);
CREATE TABLE IF NOT EXISTS "ai_module_generatedheadline" (
	"id"	integer NOT NULL,
	"pain_section_id"	integer,
	"benefit_section_id"	integer,
	"solution_section_id"	integer,
	"cta_section_id"	integer,
	"proof_section_id"	integer,
	"text"	text NOT NULL,
	"created_at"	datetime NOT NULL,
	"ctr"	real NOT NULL DEFAULT 0.0,
	"epc"	real NOT NULL DEFAULT 0.0,
	"cr"	real NOT NULL DEFAULT 0.0,
	"revenue"	real NOT NULL DEFAULT 0.0,
	"views"	integer NOT NULL DEFAULT 0,
	"leads"	integer NOT NULL DEFAULT 0,
	"sales"	integer NOT NULL DEFAULT 0,
	"spend"	real NOT NULL DEFAULT 0.0,
	"success_score"	real NOT NULL DEFAULT 0.0,
	"is_successful"	bool NOT NULL DEFAULT false,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("benefit_section_id") REFERENCES "ai_module_sectionoption"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("cta_section_id") REFERENCES "ai_module_sectionoption"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("pain_section_id") REFERENCES "ai_module_sectionoption"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("proof_section_id") REFERENCES "ai_module_sectionoption"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("solution_section_id") REFERENCES "ai_module_sectionoption"("id") DEFERRABLE INITIALLY DEFERRED
);
COMMIT;
